import { useContext } from 'react';
import { ScrapeContext } from './ScrapeContext';

export default function Data() {
  const scrapeData = useContext(ScrapeContext);
  const dataArr = scrapeData.scrapes.instagram;
  return (
    <div>
      <h2>Your Data: </h2>
      {dataArr.length
        ? dataArr.map(ele => {
            console.log(ele);
          })
        : null}
    </div>
  );
}
